  struct Prob {
    std::array<std::uint8_t, 16384> data;
    std::uint64_t h = 0;

    Prob() {
      data.fill(4);
    }

    bool get(std::uint64_t hashid){
      h = hashid;
      std::uint16_t val = data[h];
      std::uint16_t rnd = rand()%16;
      if(rnd<val){
        return true;
      }
      return false;
    }

    void update(bool outcome, bool pred){
      std::uint16_t val = data[h];
      data[h] = 0;
      data[h] = (outcome) ? std::clamp(val+1, 0, 15) : std::clamp(val-1, 0, 15);
    }

  };

  // implement hybrid between bimodal and local predictor
  struct HybridBimGsh {
    Bimodal4bit<16384> options;
    GShare loc;
    Bimodal4bit<16384> bim;
    bool locpred = false;
    bool bimpred = false;

    std::uint64_t h = 0; // stored to avoid calling hash() twice

    HybridBimGsh(){
    }

    bool get(std::uint64_t hashid){
      h = hashid;
      bool choice = options.get(h);
      locpred = loc.get(h);
      bimpred = bim.get(h);
      if(choice) return locpred;
      else return bimpred;
    }

    void update(bool outcome, bool pred){
      loc.update(outcome, locpred);
      bim.update(outcome);

      if(locpred!=bimpred){
        if(locpred==outcome){
          options.update(true);
        } else {
          options.update(false);
        }
      }
    }
  };


  // implement hybrid between Bimodal and the spaceship predictor
  struct HybridBimShip {
    Bimodal<16384> options;
    Bimodal4bit<16384> bim;
    bool bimpred = false;
    bool shippred = false;

    std::uint64_t h = 0; // stored to avoid calling hash() twice

    HybridBimShip(){
    }

    bool get(std::uint64_t hashid, bool ship){
      h = hashid;
      bool choice = options.get(h);
      bimpred = bim.get(h);
      shippred = ship;
      if(choice) return bimpred;
      else return shippred;
    }

    void update(bool outcome, bool pred){
      bim.update(outcome);

      if(bimpred!=shippred){
        if(bimpred==outcome){
          options.update(true);
        } else {
          options.update(false);
        }
      }
    }
  };





